    const { id }=useParams();


    return(



        <>
        <div>
            <b>Welcome </b>
        </div>



        <div>
        <Link to={"/front/"+id}>
        <button  id="BUT">Post</button>
        </Link>
        </div>
        </>
    )

}
export default Mainpage;
